import styled from "styled-components";

export const PageContainer = styled.div`
  // margin-top: 60px;
  height: 100vh;
  display: flex;
  flex-direction: column;
  background-color: #f8f8f8;
`;

export const Title = styled.h3`
  color: #00008b;
  font-size: 4rem;
  font-weight: bold;
  margin-bottom: 2rem;
`;

export const ProfileContainer = styled.div`
  display: flex;
  flex-direction: column;
  width: 60%;
  // align-items: center;
  // align-self: center;
`;

export const Button = styled.button`
  padding: 15px 20px;
  font-size: 1rem;
  background-color: #4d4dff;
  color: #fff;
  border: none;
  border-radius: 10px;
  cursor: pointer;
  width: 150px;
  display: flex;
  margin-left: auto;

  &:hover {
    background-color: #fff;
    color: #00008b;
  }

  &:disabled {
    background-color: #ccc;
    cursor: not-allowed;
  }
`;
